import { Keyboard, ScrollView, StyleSheet, Text, TextInput, View } from 'react-native'
import React, { useState } from 'react'
import Icon from 'react-native-vector-icons/FontAwesome';
import Chatcard from '../../Cards/Chatcard';

const All_chats = ({navigation}) => {
    let chats = [
        {   
           
            username: 'user1',
            lastmessage:'hello',
            time: '12:00',
            profile_image:'data:image/jpeg;base64,',

        },
        {
            
            username: 'user2',
            lastmessage:'hey, how are you?',
            time: '1:00',
            profile_image:'data:image/jpeg;base64,',

        },
        {
            
            username: 'user3',
            lastmessage:'hello',
            time: '12:00',
            profile_image:'data:image/jpeg;base64,',

        },
        {
           
            username: 'user4',
            lastmessage:'hey, how are you?',
            time: '1:00',
            profile_image:'data:image/jpeg;base64,',

        },
        {
           
            username: 'user5',
            lastmessage:'hello',
            time: '12:00',
            profile_image:'data:image/jpeg;base64,',

        },
        {
           
            username: 'user6',
            lastmessage:'hey, how are you?',
            time: '1:00',
            profile_image:'data:image/jpeg;base64,',

        }, 
        {
           
            username: 'user7',
            lastmessage:'hello',
            time: '12:00',
            profile_image:'data:image/jpeg;base64,',

        },
        {
           
            username: 'user8',
            lastmessage:'hey, how are you?',
            time: '1:00',
            profile_image:'data:image/jpeg;base64,',

        },
    ]

    const [keyword , setKeyword] = useState('')

    // console.log(keyword)
    
  return (
    <ScrollView style={[styles.container]}>
       <Icon name="arrow-left" size={24} color="white" style={[styles.gohomeicon]}
        onPress={() =>
      {
          navigation.navigate('Mainpage')
      }
    }
    />
    
    <View style={[styles.c1]}>
        <Text style={[styles.formHead2]}>Your Chats</Text>
        <TextInput style={[styles.searchbar]}  placeholder="Search" 
        
        onChangeText={(text) => setKeyword
            (text)}
        /> 
    </View>

    <View style={[styles.c1]}>
        {
            chats.filter(
                (chat) => {
                    if(keyword == ''){
                        return chat
                    }
                    else if(
                        chat.username.
                        toLowerCase().includes
                        (keyword.toLowerCase())
                        ||
                        chat.lastmessage.
                        toLowerCase().includes
                        (keyword.toLowerCase())
                    ) 
                    {
                        return chat
                    }
                }
            ).map((chat) => {
                return(<Chatcard 
                   
                    username={chat.username}
                    profile_image={chat.profile_image}
                    lastmessage={chat.lastmessage}
                    time={chat.time}
                    />
                    )
            })
        }
    </View>
      
    </ScrollView>
  )
}

export default All_chats

const styles = StyleSheet.create({
    container:{
        width:'100%',
        height:'100%',
        backgroundColor:'black',
    },
    gohomeicon:{
        position:'absolute',
        top:15,
        left:15,
        zIndex:100,
        color:'white',
        fontSize:30,
    },
    formHead2:{
        fontSize:20,
        color:'white',
        textAlign:'center',
        fontWeight:'bold'
    },
    c1:{
        width:'100%',
        flexDirection:'column',
        justifyContent:'center',
        alignItems:'center',
        paddingVertical:30,
        backgroundColor:'#111111',
        alignSelf:'center',
        borderRadius:20,
        borderColor:'gray',
        borderWidth:1,
    },
    searchbar:{
        width:'95%',
        backgroundColor:'white',
        borderRadius: 30,
        paddingVertical:10,
        paddingHorizontal:20,
        marginTop:10,
        fontSize:18
    },
    c2:{
        width:'100%',
        padding:10,
    }
})